<html>
<head>
<script src="https://ajax.googleapis.com/ajax/libs/jquery/1.12.0/jquery.min.js"></script>
<script type="text/javascript" src="js/jspdf.min.js"></script>
</head>

<body>
<div id="navbar"><span>jsPDF Tutorial - Form Filling</span></div>
<div id="wrapper">

		<input type="text" id="name" value=""/ placeholder="Name"><br>
		<input type="text" id="company" value="" placeholder="Company" /><br>
		<input type="text" id="department" value="" placeholder="Department" /><br>
		<input type="text" id="title" value="" placeholder="Job Title"/><br>
		<input type="button" id="button" value="Submit"/>

	<script>

	$('#button').click(function() {

		 var doc = new jsPDF();
		 var imgData = 'data:image/png;base64,';

    doc.addImage(imgData, 'PNG',0,0,215.9,279.4);



     var name = $('#name').val();
     var company = $('#company').val();
     var department = $('#department').val();
     var title = $('#title').val();

     doc.setFontSize(16);


     doc.text(60, 180, name);
     doc.text(55, 208, company);
     doc.text(23, 162, department);
     doc.text(23, 202, title);

    doc.save('test.pdf');


 });
</script>
</body>
</html>
